import React from "react";
import Chart from "react-apexcharts";

export const TestChart = () => {
  const chartOptions = {
    chart: {
      id: "bar-chart",
    },
    xaxis: {
      categories: [
        "Січень",
        "Лютий",
        "Березень",
        "Квітень",
        "Травень",
        "Червень",
      ],
    },
  };

  const chartSeries = [
    {
      name: "Продажі",
      data: [30, 40, 35, 50, 49, 60],
    },
  ];

  return (
    <div>
      <Chart
        options={chartOptions}
        series={chartSeries}
        type="line"
        height={400}
      />
    </div>
  );
};
